<!DOCTYPE html>
<html lang="es">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Ejercicio 15</title>
</head>
<body>
    <script>
        for(i=1; i<=100; i++){ //Itera 100 veces
            if(i%5 != 0){ //Si no es multiplo de 5, se imprime
                document.write(i + "<br>");
            }
        }
    </script>
</body>
